(window.webpackJsonp=window.webpackJsonp||[]).push([[34],{602:function(module,exports){eval('module.exports = "<h1 id=\\"toasts\\"><span class=\\"bd-content-title\\">Toasts</span></h1>\\n<p class=\\"bd-lead\\">Push notifications to your visitors with a <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code> and <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toaster&gt;</code>, lightweight components\\nwhich are easily customizable for generating alert messages.</p>\\n<p>Toasts are lightweight notifications designed to mimic the push notifications that have been\\npopularized by mobile and desktop operating systems.</p>\\n<p>Toasts are intended to be small interruptions to your visitors or users, and therefore should\\ncontain minimal, to-the-point, non-interactive content.</p>\\n<div class=\\"alert alert-warning\\">\\n  <p class=\\"mb-0\\">\\n    <strong>BETA warning:</strong><br>\\n    Toasts are in their preliminary stages of being developed, and usage and custom CSS is subject\\n    to change in future releases.\\n  </p>\\n</div>\\n\\n<h2 id=\\"overview\\"><span class=\\"bd-content-title\\">Overview<a class=\\"anchorjs-link\\" href=\\"#overview\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>To encourage extensible and predictable toasts, we recommend providing a header (title) and body.\\nToast headers use the style <code translate=\\"no\\" class=\\"notranslate\\">&#39;display: flex&#39;</code>, allowing easy alignment of content thanks to\\nBootstrap&#39;s <a href=\\"/docs/reference/utility-classes\\">margin and flexbox utility classes</a>.</p>\\n<p>Toasts are slightly translucent, too, so they blend over whatever they might appear over. For\\nbrowsers that support the <code translate=\\"no\\" class=\\"notranslate\\">backdrop-filter</code> CSS property, they also attempt to blur the elements\\nunder the toast.</p>\\n<pre class=\\"hljs html text-monospace p-2 notranslate\\" translate=\\"no\\"><span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">template</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">div</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"p-3 bg-secondary progress-bar-striped\\"</span> <span class=\\"hljs-attr\\">style</span>=<span class=\\"hljs-string\\">\\"min-height: 170px;\\"</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span> <span class=\\"hljs-attr\\">variant</span>=<span class=\\"hljs-string\\">\\"primary\\"</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"$bvToast.show(\'example-toast\')\\"</span>&gt;</span>\\n      Show toast\\n    <span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-toast</span> <span class=\\"hljs-attr\\">id</span>=<span class=\\"hljs-string\\">\\"example-toast\\"</span> <span class=\\"hljs-attr\\">title</span>=<span class=\\"hljs-string\\">\\"BootstrapVue\\"</span> <span class=\\"hljs-attr\\">static</span> <span class=\\"hljs-attr\\">no-auto-hide</span>&gt;</span>\\n      Hello, world! This is a toast message.\\n    <span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-toast</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">div</span>&gt;</span>\\n<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">template</span>&gt;</span>\\n\\n<span class=\\"hljs-comment\\">&lt;!-- toast-intro.vue --&gt;</span></pre><p><strong>Note:</strong> we are using the <code translate=\\"no\\" class=\\"notranslate\\">static</code> prop in the above example to render the toast in-pace in the\\ndocument, rather than transporting it to a <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toaster&gt;</code> target container. And we have added classes\\n<code translate=\\"no\\" class=\\"notranslate\\">bg-secondary</code> and <code translate=\\"no\\" class=\\"notranslate\\">progress-bar-striped</code> to the outer <code translate=\\"no\\" class=\\"notranslate\\">&lt;div&gt;</code> for illustrative purposes of toast\\ntransparency only.</p>\\n<h3 id=\\"toast-features-and-notes\\"><span class=\\"bd-content-title\\">Toast features and notes<a class=\\"anchorjs-link\\" href=\\"#toast-features-and-notes\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<ul>\\n<li>Toasts can be generated on demand via the injection <code translate=\\"no\\" class=\\"notranslate\\">this.$bvToast</code> object, or manually created\\nusing the <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code> component.</li>\\n<li>Toasts will auto hide after a default of 5 seconds (5000ms). The duration can be changed via the\\n<code translate=\\"no\\" class=\\"notranslate\\">auto-hide-delay</code> prop (value is specified in milliseconds), and disabled with the <code translate=\\"no\\" class=\\"notranslate\\">no-auto-hide</code>\\nprop.</li>\\n<li>When auto-hide is enabled, and you hover over the toast, the auto-hide countdown will be paused\\nuntil you un-hover the toast. You can disabled this feature by setting the <code translate=\\"no\\" class=\\"notranslate\\">no-hover-pause</code> prop\\nto <code translate=\\"no\\" class=\\"notranslate\\">true</code>.</li>\\n<li>Toasts include a close button on their top right to allow users to manually dismiss them. The\\nclose button can be removed via the <code translate=\\"no\\" class=\\"notranslate\\">no-close-button</code> prop.</li>\\n<li>Titles are optional, but should be included, titles are rendered inside a <code translate=\\"no\\" class=\\"notranslate\\">&lt;strong&gt;</code> element,\\nunless using the <code translate=\\"no\\" class=\\"notranslate\\">toast-title</code> slot.</li>\\n<li>If you disable the auto-hide feature, avoid hiding the close button, or if you hide the close\\nbutton be sure to allow the toast to auto-dismiss.</li>\\n<li>Toast transparency can be disabled by setting the <code translate=\\"no\\" class=\\"notranslate\\">solid</code> prop to <code translate=\\"no\\" class=\\"notranslate\\">true</code>.</li>\\n<li>Toasts will show inside a named <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toaster&gt;</code> target component. BootstrapVue comes with several\\npre-defined toaster targets. Toasts will check for the named toaster in the document before they\\nare shown, and will dynamically create the named toaster target if one is not found.</li>\\n<li>Toaster targets are defined completely with CSS for controlling the positioning of the contained\\n<code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code> components.</li>\\n<li>Toasts can can targeted to any named toaster.</li>\\n<li>Toasts are wrapped in a <code translate=\\"no\\" class=\\"notranslate\\">&lt;div&gt;</code> with class <code translate=\\"no\\" class=\\"notranslate\\">b-toast</code> to allow for Vue list-transition support when\\ndisplayed in a toaster component.</li>\\n</ul>\\n<p>BootstrapVue uses <a href=\\"https://portal-vue.linusb.org/\\">PortalVue</a> to transport toasts into the toasters.</p>\\n<h2 id=\\"toasts-on-demand\\"><span class=\\"bd-content-title\\">Toasts on demand<a class=\\"anchorjs-link\\" href=\\"#toasts-on-demand\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>Generate a dynamic toast from anywhere in your app via the <code translate=\\"no\\" class=\\"notranslate\\">this.$bvToast</code> Vue component <em>instance</em>\\ninjection, without the need to place a <a href=\\"#b-toast-component\\"><code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code></a> component in your app.</p>\\n<p>Use the <code translate=\\"no\\" class=\\"notranslate\\">this.$bvToast.toast()</code> method to generate on demand toasts. The method accepts two\\narguments:</p>\\n<ul>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">message</code>: the content of the toast body (either a string, or an array of <code translate=\\"no\\" class=\\"notranslate\\">VNodes</code>). Required.\\nToasts with an empty message will not be shown. See the <a href=\\"#advanced-usage\\">Advanced usage</a> section\\nfor an example of passing an array of <code translate=\\"no\\" class=\\"notranslate\\">VNodes</code> as the message.</li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">options</code>: an optional options object for providing a title and/or additional configuration\\noptions. The <code translate=\\"no\\" class=\\"notranslate\\">title</code> option can be either a string or an array of <code translate=\\"no\\" class=\\"notranslate\\">VNodes</code></li>\\n</ul>\\n<p>The options argument accepts most of the props that the <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code> component accepts (with the\\nexception of <code translate=\\"no\\" class=\\"notranslate\\">static</code>, and <code translate=\\"no\\" class=\\"notranslate\\">visible</code>) in <samp class=\\"notranslate\\" translate=\\"no\\">camelCase</samp> name format instead of\\n<samp class=\\"notranslate\\" translate=\\"no\\">kebab-case</samp>.</p>\\n<pre class=\\"hljs html text-monospace p-2 notranslate\\" translate=\\"no\\"><span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">template</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">div</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"makeToast()\\"</span>&gt;</span>Show Toast<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"makeToast(true)\\"</span>&gt;</span>Show Toast (appended)<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">div</span>&gt;</span>\\n<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">template</span>&gt;</span>\\n\\n<span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">script</span>&gt;</span><span class=\\"javascript\\">\\n  <span class=\\"hljs-keyword\\">export</span> <span class=\\"hljs-keyword\\">default</span> {\\n    data() {\\n      <span class=\\"hljs-keyword\\">return</span> {\\n        <span class=\\"hljs-attr\\">toastCount</span>: <span class=\\"hljs-number\\">0</span>\\n      }\\n    },\\n    <span class=\\"hljs-attr\\">methods</span>: {\\n      makeToast(append = <span class=\\"hljs-literal\\">false</span>) {\\n        <span class=\\"hljs-keyword\\">this</span>.toastCount++\\n        <span class=\\"hljs-keyword\\">this</span>.$bvToast.toast(<span class=\\"hljs-string\\">`This is toast number <span class=\\"hljs-subst\\">${<span class=\\"hljs-keyword\\">this</span>.toastCount}</span>`</span>, {\\n          <span class=\\"hljs-attr\\">title</span>: <span class=\\"hljs-string\\">\'BootstrapVue Toast\'</span>,\\n          <span class=\\"hljs-attr\\">autoHideDelay</span>: <span class=\\"hljs-number\\">5000</span>,\\n          <span class=\\"hljs-attr\\">appendToast</span>: append\\n        })\\n      }\\n    }\\n  }\\n</span><span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">script</span>&gt;</span>\\n\\n<span class=\\"hljs-comment\\">&lt;!-- toasts-bv-toast-example.vue --&gt;</span></pre><p>Once a toast which was generated using <code translate=\\"no\\" class=\\"notranslate\\">this.$bvToast.toast()</code> has been hidden, it will\\nautomatically be destroyed and removed from the document.</p>\\n<p><strong>Notes:</strong></p>\\n<ul>\\n<li>The <code translate=\\"no\\" class=\\"notranslate\\">this.$bvToast</code> injection is only available when using the full <code translate=\\"no\\" class=\\"notranslate\\">BootstrapVue</code> plugin or the\\n<code translate=\\"no\\" class=\\"notranslate\\">Toast</code> plugin. It is not available if importing just the <code translate=\\"no\\" class=\\"notranslate\\">b-toast</code> or <code translate=\\"no\\" class=\\"notranslate\\">b-toaster</code> components.</li>\\n<li>A new <code translate=\\"no\\" class=\\"notranslate\\">$bvToast</code> injection (mixin) is created for each Vue virtual machine (i.e. each instantiated\\ncomponent), and is not usable via direct access to the <code translate=\\"no\\" class=\\"notranslate\\">Vue.prototype</code>, as it needs access to the\\ninstance&#39;s <code translate=\\"no\\" class=\\"notranslate\\">this</code> and <code translate=\\"no\\" class=\\"notranslate\\">$root</code> contexts.</li>\\n<li>Toasts generated via <code translate=\\"no\\" class=\\"notranslate\\">this.$bvToast.toast()</code> are children of the Vue instance that calls the\\n<code translate=\\"no\\" class=\\"notranslate\\">this.$bvToast.toast()</code> method, and will be hidden and destroyed if that Vue instance (i.e. your\\ncomponent or app) is also destroyed.</li>\\n<li>Toasts require a message. Toasts on demand with an empty message will silently not be shown.</li>\\n</ul>\\n<h2 id=\\"options\\"><span class=\\"bd-content-title\\">Options<a class=\\"anchorjs-link\\" href=\\"#options\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>Toasts have various options that can control their style and behaviour. Options are available both\\nas props on the <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code> component and as properties of the options object passed to\\n<code translate=\\"no\\" class=\\"notranslate\\">this.$bvToast.toast()</code>. When passing options to <code translate=\\"no\\" class=\\"notranslate\\">this.$bvToast.toast()</code>, use the\\n<samp class=\\"notranslate\\" translate=\\"no\\">camelCase</samp> version of the component prop name, i.e. use <code translate=\\"no\\" class=\\"notranslate\\">noAutoHide</code> instead of\\n<code translate=\\"no\\" class=\\"notranslate\\">no-auto-hide</code>.</p>\\n<h3 id=\\"title\\"><span class=\\"bd-content-title\\">Title<a class=\\"anchorjs-link\\" href=\\"#title\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>Add a title to your toast via the <code translate=\\"no\\" class=\\"notranslate\\">title</code> option. Just like the toast <code translate=\\"no\\" class=\\"notranslate\\">message</code>, the title can be a\\nsimple string, or an array of vNodes. See the <a href=\\"#advanced-usage\\">Advanced usage</a> section for an\\nexample of passing an array of <code translate=\\"no\\" class=\\"notranslate\\">VNodes</code> as the message and title.</p>\\n<h3 id=\\"transparency\\"><span class=\\"bd-content-title\\">Transparency<a class=\\"anchorjs-link\\" href=\\"#transparency\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>Toasts have a semi-transparent background by default. To disable the default transparency, just set\\nthe <code translate=\\"no\\" class=\\"notranslate\\">solid</code> prop to <code translate=\\"no\\" class=\\"notranslate\\">true</code></p>\\n<h3 id=\\"variants\\"><span class=\\"bd-content-title\\">Variants<a class=\\"anchorjs-link\\" href=\\"#variants\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>BootstrapVue toasts provide custom CSS to define color variants. Variants follow the standard\\nBootstrap v4 variant names. If you have custom SCSS defined Bootstrap color variants, the toast\\ncustom SCSS will automatically create toast variants for you.</p>\\n<pre class=\\"hljs html text-monospace p-2 notranslate\\" translate=\\"no\\"><span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">template</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">div</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"makeToast()\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>Default<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> <span class=\\"hljs-attr\\">variant</span>=<span class=\\"hljs-string\\">\\"primary\\"</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"makeToast(\'primary\')\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>Primary<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> <span class=\\"hljs-attr\\">variant</span>=<span class=\\"hljs-string\\">\\"secondary\\"</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"makeToast(\'secondary\')\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>Secondary<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> <span class=\\"hljs-attr\\">variant</span>=<span class=\\"hljs-string\\">\\"danger\\"</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"makeToast(\'danger\')\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>Danger<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> <span class=\\"hljs-attr\\">variant</span>=<span class=\\"hljs-string\\">\\"warning\\"</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"makeToast(\'warning\')\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>Warning<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> <span class=\\"hljs-attr\\">variant</span>=<span class=\\"hljs-string\\">\\"success\\"</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"makeToast(\'success\')\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>Success<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> <span class=\\"hljs-attr\\">variant</span>=<span class=\\"hljs-string\\">\\"info\\"</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"makeToast(\'info\')\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>Info<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">div</span>&gt;</span>\\n<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">template</span>&gt;</span>\\n\\n<span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">script</span>&gt;</span><span class=\\"javascript\\">\\n  <span class=\\"hljs-keyword\\">export</span> <span class=\\"hljs-keyword\\">default</span> {\\n    <span class=\\"hljs-attr\\">methods</span>: {\\n      makeToast(variant = <span class=\\"hljs-literal\\">null</span>) {\\n        <span class=\\"hljs-keyword\\">this</span>.$bvToast.toast(<span class=\\"hljs-string\\">\'Toast body content\'</span>, {\\n          <span class=\\"hljs-attr\\">title</span>: <span class=\\"hljs-string\\">`Variant <span class=\\"hljs-subst\\">${variant || <span class=\\"hljs-string\\">\'default\'</span>}</span>`</span>,\\n          <span class=\\"hljs-attr\\">variant</span>: variant,\\n          <span class=\\"hljs-attr\\">solid</span>: <span class=\\"hljs-literal\\">true</span>\\n        })\\n      }\\n    }\\n  }\\n</span><span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">script</span>&gt;</span>\\n\\n<span class=\\"hljs-comment\\">&lt;!-- toast-variants.vue --&gt;</span></pre><h3 id=\\"toaster-target\\"><span class=\\"bd-content-title\\">Toaster target<a class=\\"anchorjs-link\\" href=\\"#toaster-target\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>BootstrapVue comes with the following &quot;built-in&quot; toaster names (and associated styles defined in\\nSCSS):</p>\\n<ul>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-top-right</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-top-left</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-top-center</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-top-full</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-bottom-right</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-bottom-left</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-bottom-center</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-bottom-full</code></li>\\n</ul>\\n<pre class=\\"hljs html text-monospace p-2 notranslate\\" translate=\\"no\\"><span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">template</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">div</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"toast(\'b-toaster-top-right\')\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>b-toaster-top-right<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"toast(\'b-toaster-top-left\')\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>b-toaster-top-left<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"toast(\'b-toaster-top-center\')\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>b-toaster-top-center<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"toast(\'b-toaster-top-full\')\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>b-toaster-top-full<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"toast(\'b-toaster-bottom-right\', true)\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>b-toaster-bottom-right<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"toast(\'b-toaster-bottom-left\', true)\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>b-toaster-bottom-left<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"toast(\'b-toaster-bottom-center\', true)\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>b-toaster-bottom-center<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"toast(\'b-toaster-bottom-full\', true)\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mb-2\\"</span>&gt;</span>b-toaster-bottom-full<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">div</span>&gt;</span>\\n<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">template</span>&gt;</span>\\n\\n<span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">script</span>&gt;</span><span class=\\"javascript\\">\\n  <span class=\\"hljs-keyword\\">export</span> <span class=\\"hljs-keyword\\">default</span> {\\n    data() {\\n      <span class=\\"hljs-keyword\\">return</span> {\\n        <span class=\\"hljs-attr\\">counter</span>: <span class=\\"hljs-number\\">0</span>\\n      }\\n    },\\n    <span class=\\"hljs-attr\\">methods</span>: {\\n      toast(toaster, append = <span class=\\"hljs-literal\\">false</span>) {\\n        <span class=\\"hljs-keyword\\">this</span>.counter++\\n        <span class=\\"hljs-keyword\\">this</span>.$bvToast.toast(<span class=\\"hljs-string\\">`Toast <span class=\\"hljs-subst\\">${<span class=\\"hljs-keyword\\">this</span>.counter}</span> body content`</span>, {\\n          <span class=\\"hljs-attr\\">title</span>: <span class=\\"hljs-string\\">`Toaster <span class=\\"hljs-subst\\">${toaster}</span>`</span>,\\n          <span class=\\"hljs-attr\\">toaster</span>: toaster,\\n          <span class=\\"hljs-attr\\">solid</span>: <span class=\\"hljs-literal\\">true</span>,\\n          <span class=\\"hljs-attr\\">appendToast</span>: append\\n        })\\n      }\\n    }\\n  }\\n</span><span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">script</span>&gt;</span>\\n\\n<span class=\\"hljs-comment\\">&lt;!-- toast-targets.vue --&gt;</span></pre><p><strong>Notes:</strong></p>\\n<ul>\\n<li>Toaster target names that have not been defined in CSS will render at the bottom of the document,\\nstacked and not positioned (appended to <code translate=\\"no\\" class=\\"notranslate\\">&lt;body&gt;</code> inside a <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toaster&gt;</code> with class name and ID set\\nto the toaster target name). The only default styling the toaster will have is a <code translate=\\"no\\" class=\\"notranslate\\">z-index</code> of\\n<code translate=\\"no\\" class=\\"notranslate\\">1100</code>.</li>\\n<li>Avoid using <code translate=\\"no\\" class=\\"notranslate\\">b-toaster-top-*</code> toasters together, or <code translate=\\"no\\" class=\\"notranslate\\">b-toaster-bottom-*</code> toasters together, at the\\nsame time in your app as notifications could be obscured/overlap on small screens (i.e. <code translate=\\"no\\" class=\\"notranslate\\">xs</code>).</li>\\n</ul>\\n<h3 id=\\"prepend-and-append\\"><span class=\\"bd-content-title\\">Prepend and append<a class=\\"anchorjs-link\\" href=\\"#prepend-and-append\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>Toasts default to prepending themselves to the top of the toasts shown in the specified toaster in\\nthe order they were created. To append new toasts to the bottom, set the <code translate=\\"no\\" class=\\"notranslate\\">append-toast</code> prop to\\n<code translate=\\"no\\" class=\\"notranslate\\">true</code>.</p>\\n<h3 id=\\"auto-hide\\"><span class=\\"bd-content-title\\">Auto-hide<a class=\\"anchorjs-link\\" href=\\"#auto-hide\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>Change to auto hide delay time via the <code translate=\\"no\\" class=\\"notranslate\\">auto-hide-delay</code> prop (value is in milliseconds), which\\ndefaults to <code translate=\\"no\\" class=\\"notranslate\\">5000</code> (minimum value <code translate=\\"no\\" class=\\"notranslate\\">1000</code>). Or, disable the auto-hide feature completely by setting\\nthe <code translate=\\"no\\" class=\\"notranslate\\">no-auto-hide</code> prop to <code translate=\\"no\\" class=\\"notranslate\\">true</code>.</p>\\n<p>When auto-hide is enabled, hovering over the toast will pause the auto-hide timer. When you un-hover\\nthe toast, the auto-hide timer will be resumed. You can disable this feature by setting the\\n<code translate=\\"no\\" class=\\"notranslate\\">no-hover-pause</code> prop to <code translate=\\"no\\" class=\\"notranslate\\">true</code>.</p>\\n<h3 id=\\"toast-roles\\"><span class=\\"bd-content-title\\">Toast roles<a class=\\"anchorjs-link\\" href=\\"#toast-roles\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>Toasts are rendered with a default <code translate=\\"no\\" class=\\"notranslate\\">role</code> attribute of <code translate=\\"no\\" class=\\"notranslate\\">&#39;alert&#39;</code> and <code translate=\\"no\\" class=\\"notranslate\\">aria-live</code> attribute of\\n<code translate=\\"no\\" class=\\"notranslate\\">&#39;assertive&#39;</code>. For toasts that are meant for a casual notification, set the <code translate=\\"no\\" class=\\"notranslate\\">is-status</code> prop to\\n<code translate=\\"no\\" class=\\"notranslate\\">true</code>, which will change the <code translate=\\"no\\" class=\\"notranslate\\">role</code> and <code translate=\\"no\\" class=\\"notranslate\\">aria-live</code> attributes to <code translate=\\"no\\" class=\\"notranslate\\">&#39;status&#39;</code> and <code translate=\\"no\\" class=\\"notranslate\\">&#39;polite&#39;</code>\\nrespectively.</p>\\n<p>For more information, please the the <a href=\\"#accessibility\\">Accessibility</a> section below.</p>\\n<h3 id=\\"links\\"><span class=\\"bd-content-title\\">Links<a class=\\"anchorjs-link\\" href=\\"#links\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>Optionally convert the toast body to a link (<code translate=\\"no\\" class=\\"notranslate\\">&lt;a&gt;</code>) or <code translate=\\"no\\" class=\\"notranslate\\">&lt;router-link&gt;</code> (or <code translate=\\"no\\" class=\\"notranslate\\">&lt;nuxt-link&gt;</code>) via the\\n<code translate=\\"no\\" class=\\"notranslate\\">href</code> and <code translate=\\"no\\" class=\\"notranslate\\">to</code> props respectively. When set, the entire toast body becomes a link.</p>\\n<pre class=\\"hljs html text-monospace p-2 notranslate\\" translate=\\"no\\"><span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">template</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">div</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"toast()\\"</span>&gt;</span>Toast with link<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">div</span>&gt;</span>\\n<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">template</span>&gt;</span>\\n\\n<span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">script</span>&gt;</span><span class=\\"javascript\\">\\n  <span class=\\"hljs-keyword\\">export</span> <span class=\\"hljs-keyword\\">default</span> {\\n    <span class=\\"hljs-attr\\">methods</span>: {\\n      toast() {\\n        <span class=\\"hljs-keyword\\">this</span>.$bvToast.toast(<span class=\\"hljs-string\\">`Toast with action link`</span>, {\\n          <span class=\\"hljs-attr\\">href</span>: <span class=\\"hljs-string\\">\'#foo\'</span>,\\n          <span class=\\"hljs-attr\\">title</span>: <span class=\\"hljs-string\\">\'Example\'</span>\\n        })\\n      }\\n    }\\n  }\\n</span><span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">script</span>&gt;</span>\\n\\n<span class=\\"hljs-comment\\">&lt;!-- toast-link.vue --&gt;</span></pre><h2 id=\\"b-toast-component\\"><span class=\\"bd-content-title\\"><code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code> component<a class=\\"anchorjs-link\\" href=\\"#b-toast-component\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>When you have a custom component that would like to display just a single toast at a time, use the\\n<code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code> component. The <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code> component can be placed anywhere in your custom component or\\napp, and does not render an element (they render a comment placeholder node which will not affect\\nlayout).</p>\\n<p>The toast can be made visible via a <code translate=\\"no\\" class=\\"notranslate\\">v-model</code> (which is tied to the <code translate=\\"no\\" class=\\"notranslate\\">visible</code> prop), or shown using\\nthe component&#39;s <code translate=\\"no\\" class=\\"notranslate\\">show()</code> and <code translate=\\"no\\" class=\\"notranslate\\">hide()</code> instance methods, or via the <code translate=\\"no\\" class=\\"notranslate\\">this.$bvToast.show(id)</code> and\\n<code translate=\\"no\\" class=\\"notranslate\\">this.$bvToast.hide(id)</code> methods (requires that a unique ID be set on the <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code> component).</p>\\n<p>Toasts, by default will be paced into the <code translate=\\"no\\" class=\\"notranslate\\">b-toaster-top-right</code> <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toaster&gt;</code> component. The toaster\\nspecified by the <code translate=\\"no\\" class=\\"notranslate\\">toaster</code> prop will be created on demand if it doesn&#39;t already exist in document.</p>\\n<p>You can force a <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code> to appear in-place in the document by setting the <code translate=\\"no\\" class=\\"notranslate\\">static</code> prop to\\n<code translate=\\"no\\" class=\\"notranslate\\">true</code>. you still need to show and hide the toast, but it will not be transported into a toaster\\ncomponent.</p>\\n<pre class=\\"hljs html text-monospace p-2 notranslate\\" translate=\\"no\\"><span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">template</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">div</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"$bvToast.show(\'my-toast\')\\"</span>&gt;</span>Show toast<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-toast</span> <span class=\\"hljs-attr\\">id</span>=<span class=\\"hljs-string\\">\\"my-toast\\"</span> <span class=\\"hljs-attr\\">variant</span>=<span class=\\"hljs-string\\">\\"warning\\"</span> <span class=\\"hljs-attr\\">solid</span>&gt;</span>\\n      <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">div</span> <span class=\\"hljs-attr\\">slot</span>=<span class=\\"hljs-string\\">\\"toast-title\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"d-flex flex-grow-1 align-items-baseline\\"</span>&gt;</span>\\n        <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-img</span> <span class=\\"hljs-attr\\">blank</span> <span class=\\"hljs-attr\\">blank-color</span>=<span class=\\"hljs-string\\">\\"#ff5555\\"</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mr-2\\"</span> <span class=\\"hljs-attr\\">width</span>=<span class=\\"hljs-string\\">\\"12\\"</span> <span class=\\"hljs-attr\\">height</span>=<span class=\\"hljs-string\\">\\"12\\"</span>&gt;</span><span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-img</span>&gt;</span>\\n        <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">strong</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mr-auto\\"</span>&gt;</span>Notice!<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">strong</span>&gt;</span>\\n        <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">small</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"text-muted mr-2\\"</span>&gt;</span>42 seconds ago<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">small</span>&gt;</span>\\n      <span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">div</span>&gt;</span>\\n      This is the content of the toast.\\n      It is short and to the point.\\n    <span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-toast</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">div</span>&gt;</span>\\n<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">template</span>&gt;</span>\\n\\n<span class=\\"hljs-comment\\">&lt;!-- toast-component.vue --&gt;</span></pre><h3 id=\\"slots\\"><span class=\\"bd-content-title\\">Slots<a class=\\"anchorjs-link\\" href=\\"#slots\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<ul>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">toast-title</code>: Content to replace the default title element.</li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">default</code>: Content of the toast body</li>\\n</ul>\\n<p>Both slots are optionally scoped with the following scope:</p>\\n<div class=\\"table-responsive-sm\\"><table class=\\"b-table table table-bordered table-striped bv-docs-table\\">\\n<thead class=\\"thead-default\\">\\n<tr>\\n<th>Method or property</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code translate=\\"no\\" class=\\"notranslate\\">hide()</code></td>\\n<td>Hides the toast when called. Useful if you are providing your own close button.</td>\\n</tr>\\n</tbody></table>\\n</div><p>Slots are only available when using the <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code> component.</p>\\n<h2 id=\\"b-toaster-target-component\\"><span class=\\"bd-content-title\\"><code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toaster&gt;</code> target component<a class=\\"anchorjs-link\\" href=\\"#b-toaster-target-component\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>The <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toaster&gt;</code> component provides a container where toasts will appear (the <em>Toaster</em>). Toasters\\nrequire a unique name, and toasts can be targeted to appear in a specific named toaster.</p>\\n<p>In most cases you will not need to directly use this component, as <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code> will automatically\\ninsert a <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toaster&gt;</code> component (appended to <code translate=\\"no\\" class=\\"notranslate\\">&lt;body&gt;</code>) with the requested toaster name if one is\\nnot found in the document. But sometimes you may want to explicitly place a toaster in your app.</p>\\n<p>The toaster <code translate=\\"no\\" class=\\"notranslate\\">name</code> becomes the ID of the inserted container, and will also be used a class name on\\nthe rendered toaster container.</p>\\n<p>Toaster positioning and the positioning of toasts inside the toaster is driven completely by CSS\\nclasses (based on the name of the toaster)</p>\\n<p>The following &quot;built-in&quot; toaster names (and associated styles) are defined in BootstrapVue&#39;s custom\\nSCSS:</p>\\n<ul>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-top-right</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-top-left</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-top-center</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-top-full</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-bottom-right</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-bottom-left</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-bottom-center</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b-toaster-bottom-full</code></li>\\n</ul>\\n<p>The above toasters place the toasts in a stacked (columnar format), fixed within the viewport\\n(meaning they will always be in view regardless of viewport scroll position). If there are more\\ntoasts than can fit on the viewport screen, some will be visually hidden offscreen until other\\ntoasts are closed/hidden.</p>\\n<p><code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code> uses the <code translate=\\"no\\" class=\\"notranslate\\">b-toaster-top-right</code> toaster by default.</p>\\n<p><strong>Notes:</strong></p>\\n<ul>\\n<li>If a <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toaster&gt;</code> with the same name already exists in document (either auto-created by\\n<code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code>, <code translate=\\"no\\" class=\\"notranslate\\">this.$bvToast.toast()</code>, or manually placed), then <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toaster&gt;</code> will just render an\\nempty <code translate=\\"no\\" class=\\"notranslate\\">&lt;div&gt;</code> element and issue a console warning.</li>\\n<li>If manually placing a <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toaster&gt;</code> component, make sure it is placed as the last element in\\nbottom of your app root element, so that it will be available to all pages in your app.</li>\\n<li>Toasters that get destroyed will be auto re-created if a new toast targeted for the toaster name\\nis shown.</li>\\n<li>In the majority of use cases, you should not need to manually place/create a <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toaster&gt;</code>\\ncomponent in your app, as they will be auto generated on demand if needed. But if you need to\\noverride any of the toaster default settings, ensure that you place the toaster in your app in a\\nlocation that will not be destroyed due to changes in the route.</li>\\n</ul>\\n<h2 id=\\"advanced-usage\\"><span class=\\"bd-content-title\\">Advanced usage<a class=\\"anchorjs-link\\" href=\\"#advanced-usage\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>When using the <code translate=\\"no\\" class=\\"notranslate\\">this.$bvToast.toast(...)</code> method for generating toasts, you may want the toast\\ncontent to be more than just a string message. As mentioned in the\\n<a href=\\"#toasts-on-demand\\">Toasts on demand</a> section above, you can pass arrays of <code translate=\\"no\\" class=\\"notranslate\\">vNodes</code> as the message\\nand title for more complex content.</p>\\n<p>Remember to keep toast content simple and to the point. Avoid placing interactive components or\\nelements inside toasts, as this can cause issues for users of assistive technologies. Refer to the\\n<a href=\\"#accessibility\\">Accessibility</a> section below.</p>\\n<p>Below is an example of using Vue&#39;s\\n<a href=\\"https://vuejs.org/v2/guide/render-function.html#The-Virtual-DOM\\"><code translate=\\"no\\" class=\\"notranslate\\">this.$createElement()</code></a> method\\nfor generating more complex toast content:</p>\\n<pre class=\\"hljs html text-monospace p-2 notranslate\\" translate=\\"no\\"><span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">template</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">div</span>&gt;</span>\\n    <span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">b-button</span> @<span class=\\"hljs-attr\\">click</span>=<span class=\\"hljs-string\\">\\"popToast\\"</span>&gt;</span>Show Toast with custom content<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">b-button</span>&gt;</span>\\n  <span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">div</span>&gt;</span>\\n<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">template</span>&gt;</span>\\n\\n<span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">script</span>&gt;</span><span class=\\"javascript\\">\\n  <span class=\\"hljs-keyword\\">export</span> <span class=\\"hljs-keyword\\">default</span> {\\n    data() {\\n      <span class=\\"hljs-keyword\\">return</span> {\\n        <span class=\\"hljs-attr\\">count</span>: <span class=\\"hljs-number\\">0</span>\\n      }\\n    },\\n    <span class=\\"hljs-attr\\">methods</span>: {\\n      popToast() {\\n        <span class=\\"hljs-comment\\">// Use a shorter name for this.$createElement</span>\\n        <span class=\\"hljs-keyword\\">const</span> h = <span class=\\"hljs-keyword\\">this</span>.$createElement\\n        <span class=\\"hljs-comment\\">// Increment the toast count</span>\\n        <span class=\\"hljs-keyword\\">this</span>.count++\\n        <span class=\\"hljs-comment\\">// Create the message</span>\\n        <span class=\\"hljs-keyword\\">const</span> vNodesMsg = h(\\n          <span class=\\"hljs-string\\">\'p\'</span>,\\n          { <span class=\\"hljs-attr\\">class</span>: [<span class=\\"hljs-string\\">\'text-center\'</span>, <span class=\\"hljs-string\\">\'mb-0\'</span>] },\\n          [\\n            h(<span class=\\"hljs-string\\">\'b-spinner\'</span>, { <span class=\\"hljs-attr\\">props</span>: { <span class=\\"hljs-attr\\">type</span>: <span class=\\"hljs-string\\">\'grow\'</span>, <span class=\\"hljs-attr\\">small</span>: <span class=\\"hljs-literal\\">true</span> } }),\\n            <span class=\\"hljs-string\\">\' Flashy \'</span>,\\n            h(<span class=\\"hljs-string\\">\'strong\'</span>, {}, <span class=\\"hljs-string\\">\'toast\'</span>),\\n            <span class=\\"hljs-string\\">` message #<span class=\\"hljs-subst\\">${<span class=\\"hljs-keyword\\">this</span>.count}</span> `</span>,\\n            h(<span class=\\"hljs-string\\">\'b-spinner\'</span>, { <span class=\\"hljs-attr\\">props</span>: { <span class=\\"hljs-attr\\">type</span>: <span class=\\"hljs-string\\">\'grow\'</span>, <span class=\\"hljs-attr\\">small</span>: <span class=\\"hljs-literal\\">true</span> } })\\n          ]\\n        )\\n        <span class=\\"hljs-comment\\">// Create the title</span>\\n        <span class=\\"hljs-keyword\\">const</span> vNodesTitle = h(\\n          <span class=\\"hljs-string\\">\'div\'</span>,\\n          { <span class=\\"hljs-attr\\">class</span>: [<span class=\\"hljs-string\\">\'d-flex\'</span>, <span class=\\"hljs-string\\">\'flex-grow-1\'</span>, <span class=\\"hljs-string\\">\'align-items-baseline\'</span>, <span class=\\"hljs-string\\">\'mr-2\'</span>] },\\n          [\\n            h(<span class=\\"hljs-string\\">\'strong\'</span>, { <span class=\\"hljs-attr\\">class</span>: <span class=\\"hljs-string\\">\'mr-2\'</span> }, <span class=\\"hljs-string\\">\'The Title\'</span>),\\n            h(<span class=\\"hljs-string\\">\'small\'</span>, { <span class=\\"hljs-attr\\">class</span>: <span class=\\"hljs-string\\">\'ml-auto text-italics\'</span> }, <span class=\\"hljs-string\\">\'5 minutes ago\'</span>)\\n          ]\\n        )\\n        <span class=\\"hljs-comment\\">// Pass the vNodes as an array for message and title</span>\\n        <span class=\\"hljs-keyword\\">this</span>.$bvToast.toast([vNodesMsg], {\\n          <span class=\\"hljs-attr\\">title</span>: [vNodesTitle],\\n          <span class=\\"hljs-attr\\">solid</span>: <span class=\\"hljs-literal\\">true</span>,\\n          <span class=\\"hljs-attr\\">variant</span>: <span class=\\"hljs-string\\">\'info\'</span>\\n        })\\n      }\\n    }\\n }\\n</span><span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">script</span>&gt;</span>\\n\\n<span class=\\"hljs-comment\\">&lt;!-- toasts-advanced.vue --&gt;</span></pre><h2 id=\\"accessibility\\"><span class=\\"bd-content-title\\">Accessibility<a class=\\"anchorjs-link\\" href=\\"#accessibility\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>Toasts are intended to be <strong>small interruptions</strong> to your visitors or users, so to help those with\\nscreen readers and similar assistive technologies, toasts are wrapped in an aria-live region.\\nChanges to live regions (such as injecting/updating a toast component) are automatically announced\\nby screen readers without needing to move the user&#39;s focus or otherwise interrupt the user.\\nAdditionally, <code translate=\\"no\\" class=\\"notranslate\\">aria-atomic=&quot;true&quot;</code> is automatically set to ensure that the entire toast is always\\nannounced as a single (atomic) unit, rather than announcing what was changed (which could lead to\\nproblems if you only update part of the toast&#39;s content, or if displaying the same toast content at\\na later point in time).</p>\\n<h3 id=\\"accessibility-tips\\"><span class=\\"bd-content-title\\">Accessibility tips<a class=\\"anchorjs-link\\" href=\\"#accessibility-tips\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>Typically, toast messages should display one or two-line non-critical messages that <strong>do not</strong>\\nrequire user interaction. Without taking extra steps, toasts can have numerous accessibility issues\\nthat can impact both people with and without disabilities. The following list, while not complete,\\nprovides general guidelines when using toasts.</p>\\n<ul>\\n<li>If the information needed is important for the process, e.g. for a list of errors in a form, then\\nuse the <a href=\\"/docs/components/alert\\"><code translate=\\"no\\" class=\\"notranslate\\">&lt;b-alert&gt;</code></a> component instead of <code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code>.</li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">&lt;b-toast&gt;</code>, by default, sets the attributes <code translate=\\"no\\" class=\\"notranslate\\">role</code> to <code translate=\\"no\\" class=\\"notranslate\\">&#39;alert&#39;</code> and <code translate=\\"no\\" class=\\"notranslate\\">aria-live</code> to <code translate=\\"no\\" class=\\"notranslate\\">&#39;assertive&#39;</code>.\\nIf it&#39;s an important message like an error, this default setting is appropriate, otherwise set the\\nprop <code translate=\\"no\\" class=\\"notranslate\\">is-status</code> to <code translate=\\"no\\" class=\\"notranslate\\">true</code> which will change the attributes <code translate=\\"no\\" class=\\"notranslate\\">role</code> to <code translate=\\"no\\" class=\\"notranslate\\">&#39;status&#39;</code> and <code translate=\\"no\\" class=\\"notranslate\\">aria-live</code>\\nto <code translate=\\"no\\" class=\\"notranslate\\">&#39;polite&#39;</code>.</li>\\n<li>Avoid popping up a toast message on page load. Performing unexpected actions on page load is very\\nconfusing to screen reader users. If a toast is needed on page load or route change, delay showing\\nthe toast by several seconds so that the screen reader will finishing announcing information about\\nthe current page without interruption by a the toast.</li>\\n<li>When setting prop <code translate=\\"no\\" class=\\"notranslate\\">auto-hide</code> to <code translate=\\"no\\" class=\\"notranslate\\">false</code>, you must have a close button to allow users to dismiss\\nthe toast. If you have also set prop <code translate=\\"no\\" class=\\"notranslate\\">no-close-button</code> to true, you must provide your own close\\nbutton or dismiss the toast by some other means. Toasts have a tab index of <code translate=\\"no\\" class=\\"notranslate\\">0</code> so that they can\\nbe reached by keyboard-only users.</li>\\n<li>Avoid initiating many toasts in quick succession, as screen readers may interrupt reading the\\ncurrent toast and announce the new toast, causing the context of the previous toast to be missed.</li>\\n<li>For toasts with long textual content, adjust the <code translate=\\"no\\" class=\\"notranslate\\">auto-hide-delay</code> to a larger timout, to allow\\nusers time to read the content of the toast. A good length of time to keep messages up is 4\\nseconds plus 1 extra second for every 100 words, rounding up. This is approximately how fast the\\naverage person reads. That means the shortest default that should be used as a best practice is 5\\nseconds (5000ms). In addition to a reasonable default timeout, you could also allow the user to\\nchoose how long they want toasts to stay up for. Most people inherently understand whether they\\nare fast or slow readers. Having a profile setting that is part of the user login will allow slow\\nreaders to pick a longer time if the messages are going away too fast, and fast readers to pick a\\nshort time if the messages are staying up too long.</li>\\n<li>To account for memory loss and distraction as well as disability-related issues such as ADHD, a\\nbest practice would be to implement a location where users can refer to a list of past toast\\nmessages which have been shown. Preferably this list should be sortable, with the default being\\nchronological.</li>\\n</ul>\\n<h3 id=\\"internet-explorer-screen-reader-support\\"><span class=\\"bd-content-title\\">Internet Explorer screen reader support<a class=\\"anchorjs-link\\" href=\\"#internet-explorer-screen-reader-support\\" aria-label=\\"Anchor\\"></a></span></h3>\\n<p>Unfortunately, IE 11 when used with <a href=\\"https://github.com/nvaccess/nvda\\">NVDA</a> or\\n<a href=\\"http://www.freedomscientific.com/products/software/jaws/\\">JAWS</a> screen readers, will not properly\\nannounce/voice toasts when they appear. If you have a large non-sighted user-base using IE 11, you\\nmay want to create an additional off-screen <code translate=\\"no\\" class=\\"notranslate\\">aria-live</code> region for IE 11 browsers only (created on\\npage load) where copies of toast message text are placed dynamically, in addition to displaying\\ntoasts.</p>\\n\x3c!-- Component reference added automatically from component package.json --\x3e\\n";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///602\n')}}]);